(10, 'adviser_denied', 'Correo cuando se deniaga un publicista', 'english', 'info@iandresa.com', 'IANDRESA: Notification of Advertising Creation', '<html>\r\n<body>\r\nHello {client_name}:<br>\r\n<br>\r\nIt seems that there is a problem with your advertising because we were not able to approve it. Please contact <a href="mailto:support@iandresa.com">support@iandresa.com</a><br>\r\n<br>\r\nWe appreciate your interest in IANDRESA<br>\r\n<br>\r\nOn the other hand, did you know also that IANDRESA let you manage your business remotely from Internet? So, what can you do with IANDRESA?<br>\r\n<ul>\r\n<li>Manage your Clients, Items, Suppliers, Warehouse, Employees and Sales.</li>\r\n<li>Generate reports of your Sales, Suppliers and Clients.</li>\r\n<li>Create other branches in the case you may have or want to have more shops.</li>\r\n<li>A free trial by one month the additional modules of Orders and/or Delivery, and purchase them in case they fit you business needs.</li>\r\n<li>A free trial by one month the additional reports of Categories, Items, Employees, Taxes, Discounts, and Payments, and purchase them in case they fit you business needs.</li>\r\n<li>Purchase banners in order to advertise and promote your product and/or services.</li>\r\n<li>Request a custom development according to the needs of your business.</li>\r\n<li>In brief, you can manage your business from Internet.</li>\r\n</ul>\r\n<br>\r\nHow you can start to manage and/or advertise your business?<br>\r\nLog on to <a href=''{base_url}''>{base_url}</a> with your username and password, and start to manage your business from Internet.<br>\r\n<br>\r\nDid you know that advertise your product and/or service at IANDRESA is very important? <br>\r\nThere are several companies use daily IANDRESA as Sales Management System to manage their business. <br>\r\n<br>\r\nIANDRESA’s clients will see your product and/or service at IANDRESA. In case you are already advertising in other Medias, you can extend your audience through IANDRESA and reach your potential clients before they know of your product and/or service.<br>\r\n<br>\r\nHow you can purchase additional modules and/or advertisement at IANDRESA?<br>\r\nIf you would like to purchase additional modules and/or advertisement, click in the link below to see our prices:<br>\r\n<br>\r\n<a href=''{base_url}{compra}''>{base_url}{compra}</a><br>\r\n<br>\r\nHow can I recover my username and/or password?<br>\r\nIf you forgot your username and/or password, you can recover it/them by clicking in the link below:<br>\r\n<br>\r\n<a href=''{base_url}{recuperar}/english''>{base_url}{recuperar}/english</a><br>\r\n<br>\r\nIf your email program doesn’t allow you to clink on these links, please Copy the link text and paste it/them in the address bar of your internet browser program.<br>\r\n<br>\r\nBest Regards, <br>\r\nIANDRESA (We are here)<br>\r\n<br>\r\n<a title="Servicios" href="{base_url}index.php/login/show_menu/english/Services" style="text-decoration: none">\r\n<img alt=''IANDRESA'' width=''100'' src=''{base_url}images/logotipo/iandresalogomouse.png''/>\r\n</a>\r\n<br>\r\nFor inquiries and questions, please contact us via <a href="mailto:support@iandresa.com">support@iandresa.com</a>\r\n</body>\r\n</html>'),
(11, 'enterprise_created', 'Correo de creacion de empresa y publicidad', 'spanish', 'support@iandresa.com', 'IANDRESA: Correo de creacion de empresa', '<html>\r\n<body>\r\nHola {client_name}:<br>\r\n<br>\r\n¡Has activado tu cuenta correctamente! ¡Ya puedes empezar a gestionar tu negocio remotamente desde Internet o publicar tu producto y/o servicio en IANDRESA ¡Te deseamos mucho éxito!!!<br>\r\n<br>\r\n¿Qué puedes hacer con IANDRESA? <br>\r\n<ul>\r\n<li>Administrar tus Clientes, Artículos, Proveedores, Almacén, Empleados y Ventas.</li>\r\n<li>Generar reportes de tus Ventas, Proveedores y Clientes.</li>\r\n<li>Crear otra sucursal en el caso que tengas otros locales.</li>\r\n<li>Probar gratuitamente por 1 mes los módulos adicionales de Pedidos y/o Entrega, y adquirirlos posteriormente en caso que se adecuen a las necesidades de tu negocio.</li>\r\n<li>Probar gratuitamente por 1 mes los reportes adicionales de Categorías, Artículos, Empleados, Impuestos, Descuentos y Pagos, y adquirirlos posteriormente en caso que se adecuen a las necesidades de tu negocio.</li>\r\n<li>Adquirir espacio de publicidad para promover tu producto y/o servicio.</li>\r\n<li>Solicitar un desarrollo a la medida de tus necesidades.</li>\r\n<li>En resumen gestionar tu negocio desde Internet.</li>\r\n</ul>\r\n<br>\r\n¿Cómo comenzar a gestionar y/o publicar tu negocio?<br>\r\nIngresa a <a href=''{base_url}''>{base_url}</a> con tu nombre de usuario y contraseña, y empieza a gestionar tu negocio desde Internet.<br>\r\n<br>\r\n¿Sabías por qué es importante tener publicidad en IANDRESA? <br>\r\nMuchas empresas utilizan diariamente IANDRESA como sistema de gestión de ventas para administrar sus negocios. <br>\r\n<br>\r\nLos clientes de IANDRESA podrán relacionar tu producto y/o servicio al verlo en nuestro sistema. Si ya estas publicando en otros medios, puedes ampliar tu cobertura a través de IANDRESA y así llegar a tu público objetivo antes de que sepan que necesitan tu producto y/o servicio.<br>\r\n<br>\r\n¿Cómo adquirir módulos adicionales y/o publicidad en IANDRESA?<br>\r\nSi quieres adquirir módulos adicionales y/o publicidad pincha en el vínculo de abajo para ver nuestros precios:<br>\r\n<br>\r\n<a href=''{base_url}{compra}''>{base_url}{compra}</a><br>\r\n<br>\r\n¿Cómo recuperar mi usuario y/o contraseña?<br>\r\nSi olvidaste tu nombre de usuario y/o contraseña puedes recuperarla pinchando en el vínculo abajo:<br>\r\n<br>\r\n<a href=''{base_url}{recuperar}/spanish''>{base_url}{recuperar}/spanish</a><br>\r\n<br>\r\nSi tu programa de correo electrónico no te permite pinchar en los vínculos, copia el texto del vínculo y pégalo en la barra de dirección de tu explorador de Internet.<br>\r\n<br>\r\nSaludos Cordiales, <br>\r\nIANDRESA (Estamos aquí) <br>\r\n<br>\r\n<a title="Servicios" href="{base_url}index.php/login/show_menu/english/Services" style="text-decoration: none">\r\n<img alt=''IANDRESA'' width=''100'' src=''{base_url}images/logotipo/iandresalogoraton.png''/>\r\n</a>\r\n<br>\r\nSi tienes alguna duda, contáctanos a <a href="mailto:support@iandresa.com">support@iandresa.com</a>\r\n</body>\r\n</html>'),
(12, 'adviser_created', 'Correo de creacion de publicista', 'spanish', 'support@iandresa.com', 'IANDRESA: Notificacion de creacion de publicista', '<html>\r\n<body>\r\nHola {client_name}:<br>\r\n<br>\r\n¡Has activado tu cuenta de publicidad correctamente! ¡Te deseamos mucho éxito!!!<br>\r\n<br>\r\nSabías que IANDRESA te permite gestionar tu negocio remotamente desde Internet? Entonces, ¿Qué puedes hacer con IANDRESA?<br>\r\n<ul>\r\n<li>Administrar tus Clientes, Artículos, Proveedores, Almacén, Empleados y Ventas.</li>\r\n<li>Generar reportes de tus Ventas, Proveedores y Clientes.</li>\r\n<li>Crear otra sucursal en el caso que tengas otros locales.</li>\r\n<li>Probar gratuitamente por 1 mes los módulos adicionales de Pedidos y/o Entrega, y adquirirlos posteriormente en caso que se adecuen a las necesidades de tu negocio.</li>\r\n<li>Probar gratuitamente por 1 mes los reportes adicionales de Categorías, Artículos, Empleados, Impuestos, Descuentos y Pagos, y adquirirlos posteriormente en caso que se adecuen a las necesidades de tu negocio.</li>\r\n<li>Adquirir espacio de publicidad para promover tu producto y/o servicio.</li>\r\n<li>Solicitar un desarrollo a la medida de tus necesidades.</li>\r\n<li>En resumen gestionar tu negocio desde Internet.</li>\r\n</ul>\r\n<br>\r\n¿Cómo comenzar a gestionar y/o publicar tu negocio?<br>\r\nIngresa a <a href="{base_url}">{base_url}</a> con tu nombre de usuario y contraseña, y empieza a gestionar tu negocio desde Internet.<br>\r\n<br>\r\n¿Sabías por qué es importante tener publicidad en IANDRESA? <br>\r\nMuchas empresas utilizan diariamente IANDRESA como sistema de gestión de ventas para administrar sus negocios. <br>\r\n<br>\r\nLos clientes de IANDRESA podrán relacionar tu producto y/o servicio al verlo en nuestro sistema. Si ya estas publicando en otros medios, puedes ampliar tu cobertura a través de IANDRESA y así llegar a tu público objetivo antes de que sepan que necesitan tu producto y/o servicio.<br>\r\n<br>\r\n¿Cómo adquirir módulos adicionales y/o publicidad en IANDRESA?<br>\r\nSi quieres adquirir módulos adicionales y/o publicidad pincha en el vínculo de abajo para ver nuestros precios:<br>\r\n<br>\r\n<a href="{base_url}{compra}">{base_url}{compra}</a><br>\r\n<br>\r\n¿Cómo recuperar mi usuario y/o contraseña?<br>\r\nSi olvidaste tu nombre de usuario y/o contraseña puedes recuperarla pinchando en el vínculo abajo:<br>\r\n<br>\r\n<a href="{base_url}{recuperar}/spanish">{base_url}{recuperar}/spanish</a><br>\r\n<br>\r\nSi tu programa de correo electrónico no te permite pinchar en los vínculos, copia el texto del vínculo y pégalo en la barra de dirección de tu explorador de Internet.<br>\r\n<br>\r\nSaludos Cordiales, <br>\r\nIANDRESA (Estamos aquí) <br>\r\n<br>\r\n<a title="Servicios" href="{base_url}index.php/login/show_menu/english/Services" style="text-decoration: none">\r\n<img alt="IANDRESA" width="100" src="{base_url}images/logotipo/iandresalogoraton.png"/>\r\n</a>\r\n<br>\r\nSi tienes alguna duda, contáctanos a <a href="mailto:support@iandresa.com">support@iandresa.com</a>\r\n</body>\r\n</html>'),
(13, 'inactivity_account', 'Correo de Inactividad', 'spanish', 'support@iandresa.com', 'IANDRESA: Correo de Inactividad', '<html>\r\n<body>\r\nHola {client_name}:<br>\r\n<br>\r\nHemos visto que tu cuenta de IANDRESA está activada pero no has realizado operaciones últimamente.<br>\r\n<br>\r\n¿Qué puedes hacer con IANDRESA? <br>\r\n<ul>\r\n<li>Administrar tus Clientes, Artículos, Proveedores, Almacén, Empleados y Ventas.</li>\r\n<li>Generar reportes de tus Ventas, Proveedores y Clientes.</li>\r\n<li>Crear otra sucursal en el caso que tengas otros locales.</li>\r\n<li>Probar gratuitamente por 1 mes los módulos adicionales de Pedidos y/o Entrega, y adquirirlos posteriormente en caso que se adecuen a las necesidades de tu negocio.</li>\r\n<li>Probar gratuitamente por 1 mes los reportes adicionales de Categorías, Artículos, Empleados, Impuestos, Descuentos y Pagos, y adquirirlos posteriormente en caso que se adecuen a las necesidades de tu negocio.</li>\r\n<li>Adquirir espacio de publicidad para promover tu producto y/o servicio.</li>\r\n<li>Solicitar un desarrollo a la medida de tus necesidades.</li>\r\n<li>En resumen gestionar tu negocio desde Internet.</li>\r\n</ul>\r\n<br>\r\n¿Cómo comenzar a gestionar y/o publicar tu negocio?<br>\r\nIngresa a <a href=''{base_url}''>{base_url}</a> con tu nombre de usuario y contraseña, y empieza a gestionar tu negocio desde Internet.<br>\r\n<br>\r\n¿Sabías por qué es importante tener publicidad en IANDRESA? <br>\r\nMuchas empresas utilizan diariamente IANDRESA como sistema de gestión de ventas para administrar sus negocios. <br>\r\n<br>\r\nLos clientes de IANDRESA podrán relacionar tu producto y/o servicio al verlo en nuestro sistema. Si ya estas publicando en otros medios, puedes ampliar tu cobertura a través de IANDRESA y así llegar a tu público objetivo antes de que sepan que necesitan tu producto y/o servicio.<br>\r\n<br>\r\n¿Cómo adquirir módulos adicionales y/o publicidad en IANDRESA?<br>\r\nSi quieres adquirir módulos adicionales y/o publicidad pincha en el vínculo de abajo para ver nuestros precios:<br>\r\n<br>\r\n<a href=''{base_url}{compra}''>{base_url}{compra}</a><br>\r\n<br>\r\n¿Cómo recuperar mi usuario y/o contraseña?<br>\r\nSi olvidaste tu nombre de usuario y/o contraseña puedes recuperarla pinchando en el vínculo abajo:<br>\r\n<br>\r\n<a href=''{base_url}{recuperar}/spanish''>{base_url}{recuperar}/spanish</a><br>\r\n<br>\r\nSi tu programa de correo electrónico no te permite pinchar en los vínculos, copia el texto del vínculo y pégalo en la barra de dirección de tu explorador de Internet.<br>\r\n<br>\r\nSaludos Cordiales, <br>\r\nIANDRESA (Estamos aquí)<br>\r\n<br>\r\n<a title="Servicios" href="{base_url}index.php/login/show_menu/english/Services" style="text-decoration: none">\r\n<img alt=''IANDRESA'' width=''100'' src=''{base_url}images/logotipo/iandresalogoraton.png''/>\r\n</a>\r\n<br>\r\nSi tienes alguna duda, contáctanos a <a href="mailto:support@iandresa.com">support@iandresa.com</a>\r\n</body>\r\n</html>'),
(14, 'recover_username', 'Correo de recuperacion nombre de usuario y cambio ', 'spanish', 'support@iandresa.com', 'IANDRESA: Correo de recuperacion nombre de usuario y cambio ', '<html>\r\n<body>\r\nHola {client_name}:<br>\r\n<br>\r\nHas decidido recuperar tu nombre de usuario y clave secreta. Te enviamos este mensaje para confirmar la dirección de tu correo electrónico.<br>\r\n<br>\r\nPor favor, pinchar en el siguiente vínculo y a continuación responder la pregunta de seguridad que se  introdujo al momento de registrarse:<br>\r\n<br>\r\n<a href=''{base_url}{recuperar}/spanish''>{base_url}{recuperar}/spanish</a><br>\r\n<br>\r\nTe recordamos que para cambiar nuevamente tu contraseña o la de tus empleados, puedes hacerlo desde la caja de “Empleados”, editando sus propiedades.<br>\r\n<br>\r\nSi tu programa de correo electrónico no te permite pinchar en el vínculo, copia el texto del vínculo y pégalo en la barra de dirección de tu explorador de Internet.<br>\r\n<br>\r\nSaludos Cordiales, <br>\r\nIANDRESA (Estamos aquí) <br>\r\n<br>\r\n<a title="Servicios" href="{base_url}index.php/login/show_menu/english/Services" style="text-decoration: none">\r\n<img alt=''IANDRESA'' width=''100'' src=''{base_url}images/logotipo/iandresalogoraton.png''/>\r\n</a>\r\n<br>\r\nSi tienes alguna duda, contáctanos a <a href="mailto:support@iandresa.com">support@iandresa.com</a>\r\n</body>\r\n</html>'),
(15, 'recover_password', 'Correo de recuperacion de clave', 'spanish', 'support@iandresa.com', 'IANDRESA: Correo de recuperacion de clave', '<html>\r\n<body>\r\nHola {client_name}:<br>\r\n<br>\r\nHas decidido recuperar tu clave secreta. Te enviamos este mensaje para confirmar la dirección de tu correo electrónico.<br>\r\n<br>\r\nA continuación esta la información que solicitaste:<br>\r\nUsuario: {username}<br>\r\nContraseña: {password}<br>\r\n<br>\r\nLe recordamos que para cambiar nuevamente tu contraseña o la de sus empleados, puedes hacerlo desde la caja de “Empleados” si usted tiene una cuenta de empresa.<br>\r\n<br>\r\nEn caso de que tenga una cuenta de anunciante, por favor, tenga en cuenta que es posible cambiar la contraseña desde el perfil del publicista.<br>\r\n<br>\r\nSaludos Cordiales, <br>\r\nIANDRESA (Estamos aquí) <br>\r\n<br>\r\n<a title="Servicios" href="{base_url}index.php/login/show_menu/english/Services" style="text-decoration: none">\r\n<img alt=''IANDRESA'' width=''100'' src=''{base_url}images/logotipo/iandresalogoraton.png''/>\r\n</a>\r\n<br>\r\nSi tienes alguna duda, contáctanos a <a href="mailto:support@iandresa.com">support@iandresa.com</a>\r\n</body>\r\n</html>'),
(16, 'warning_module_trial_expire', 'Correo previo (10 o 5 dias) para deshabilitar modulos de Pedidos, Entrega y Reportes	', 'spanish', 'info@iandresa.com', 'IANDRESA: Correo previo (10 o 5 dias) para deshabilitar modulos de Pedidos, Entrega y Reportes', '<html>\r\n<body>\r\nHola {client_name}:<br>\r\n<br>\r\nEsperamos que estés utilizando los módulos adicionales durante este mes de prueba. No olvides que sólo quedan <variable: 5 o 10> días para que termine el período de prueba.<br>\r\n<br>\r\nRecuerda que con los módulos de Pedido y/o Entrega es más fácil hacer el seguimiento a una orden que se encuentra en ese proceso, y así poder vincularla con tu venta.<br>\r\n<br>\r\nAdemás con los reportes adicionales de Categorías, Artículos, Empleados, Impuestos, Descuentos y Pagos, tienes más información para la toma de decisiones en tu negocio.<br>\r\n<br>\r\n¿Cómo adquirir módulos adicionales y/o publicidad en IANDRESA?<br>\r\nSi quieres adquirir módulos adicionales y/o publicidad pincha en el vínculo de abajo para ver nuestros precios:<br>\r\n<br>\r\n<a href=''{base_url}{compra}''>{base_url}{compra}</a><br>\r\n<br>\r\n¿Qué puedes hacer con IANDRESA? <br>\r\n<ul>\r\n<li>Administrar tus Clientes, Artículos, Proveedores, Almacén, Empleados y Ventas.</li>\r\n<li>Generar reportes de tus Ventas, Proveedores y Clientes.</li>\r\n<li>Crear otra sucursal en el caso que tengas otros locales.</li>\r\n<li>Probar gratuitamente por 1 mes los módulos adicionales de Pedidos y/o Entrega, y adquirirlos posteriormente en caso que se adecuen a las necesidades de tu negocio.</li>\r\n<li>Probar gratuitamente por 1 mes los reportes adicionales de Categorías, Artículos, Empleados, Impuestos, Descuentos y Pagos, y adquirirlos posteriormente en caso que se adecuen a las necesidades de tu negocio.</li>\r\n<li>Adquirir espacio de publicidad para promover tu producto y/o servicio.</li>\r\n<li>Solicitar un desarrollo a la medida de tus necesidades.</li>\r\n<li>En resumen gestionar tu negocio desde Internet.</li>\r\n</ul>\r\n<br>\r\n¿Cómo comenzar a gestionar y/o publicar tu negocio? <br>\r\nIngresar a <a href=''{base_url}''>{base_url}</a> con tu nombre de usuario y contraseña, y empieza a gestionar tu negocio desde Internet.<br>\r\n<br>\r\n¿Sabías por qué es importante tener publicidad en IANDRESA? <br>\r\nMuchas empresas utilizan diariamente IANDRESA como sistema de gestión de ventas para administrar sus negocios. <br>\r\n<br>\r\nLos clientes de IANDRESA podrán relacionar tu producto y/o servicio al verlo en nuestro sistema. Si ya estas publicando en otros medios, puedes ampliar tu cobertura a través de IANDRESA y así llegar a tu público objetivo antes de que sepan que necesitan tu producto y/o servicio.<br>\r\n<br>\r\n¿Cómo recuperar mi usuario y/o contraseña?<br>\r\nSi olvidaste tu nombre de usuario y/o contraseña puedes recuperarla pinchando en el vínculo abajo:<br>\r\n<br>\r\n<a href=''{base_url}{recuperar}/spanish''>{base_url}{recuperar}/spanish</a><br>\r\n<br>\r\nSi tu programa de correo electrónico no te permite pinchar en el vínculo, copia el texto del vínculo y pégalo en la barra de dirección de tu explorador de Internet.<br>\r\n<br>\r\nSaludos Cordiales, <br>\r\nIANDRESA (Estamos aquí) <br>\r\n<br>\r\n<a title="Servicios" href="{base_url}index.php/login/show_menu/english/Services" style="text-decoration: none">\r\n<img alt=''IANDRESA'' width=''100'' src=''{base_url}images/logotipo/iandresalogoraton.png''/>\r\n</a>\r\n<br>\r\nSi tienes alguna duda, contáctanos a <a href="mailto:support@iandresa.com">support@iandresa.com</a>\r\n</body>\r\n</html>'),
