(18, 'module_purchased', 'Correo compra modulos de Pedidos, Entrega y/o Reportes', 'spanish', 'support@iandresa.com', 'IANDRESA: Correo compra modulos de Pedidos, Entrega y/o Reportes', '<html>\r\n<body>\r\nHola {client_name}:<br>\r\n<br>\r\nGracias por adquirir el módulo de {purchased_module}<br>\r\n<br>\r\nRecuerda que con los módulos de Pedido y/o Entrega es más fácil hacer el seguimiento a una orden que se encuentra en ese proceso, y así poder vincularla con tu venta. <br>\r\n<br>\r\nAdemás con los reportes adicionales de Categorías, Artículos, Empleados, Impuestos, Descuentos y Pagos, tienes más información para la toma de decisiones en tu negocio.<br>\r\n<br>\r\n¿Qué puedes hacer con IANDRESA? <br>\r\n<ul>\r\n<li>Administrar tus Clientes, Artículos, Proveedores, Almacén, Empleados y Ventas.</li>\r\n<li>Generar reportes de tus Ventas, Proveedores y Clientes.</li>\r\n<li>Crear otra sucursal en el caso que tengas otros locales.</li>\r\n<li>Probar gratuitamente por 1 mes los módulos adicionales de Pedidos y/o Entrega, y adquirirlos posteriormente en caso que se adecuen a las necesidades de tu negocio.</li>\r\n<li>Probar gratuitamente por 1 mes los reportes adicionales de Categorías, Artículos, Empleados, Impuestos, Descuentos y Pagos, y adquirirlos posteriormente en caso que se adecuen a las necesidades de tu negocio.</li>\r\n<li>Adquirir espacio de publicidad para promover tu producto y/o servicio.</li>\r\n<li>Solicitar un desarrollo a la medida de tus necesidades.</li>\r\n<li>En resumen gestionar tu negocio desde Internet.</li>\r\n</ul>\r\n<br>\r\n¿Cómo comenzar a gestionar y/o publicar tu negocio? <br>\r\nIngresa a <a href=''{base_url}''>{base_url}</a> con tu nombre de usuario y contraseña, y empieza a gestionar tu negocio desde Internet.<br>\r\n<br>\r\n¿Sabías por qué es importante tener publicidad en IANDRESA? <br>\r\nMuchas empresas utilizan diariamente IANDRESA como sistema de gestión de ventas para administrar sus negocios. <br>\r\n<br>\r\nLos clientes de IANDRESA podrán relacionar tu producto y/o servicio al verlo en nuestro sistema. Si ya estas publicando en otros medios, puedes ampliar tu cobertura a través de IANDRESA y así llegar a tu público objetivo antes de que sepan que necesitan tu producto y/o servicio.<br>\r\n<br>\r\n¿Cómo adquirir módulos adicionales y/o publicidad en IANDRESA?<br>\r\nSi quieres adquirir módulos adicionales y/o publicidad pincha en el vínculo de abajo para ver nuestros precios:<br>\r\n<br>\r\n<a href=''{base_url}{compra}''>{base_url}{compra}</a><br>\r\n<br>\r\n¿Cómo recuperar mi usuario y/o contraseña?<br>\r\nSi olvidaste tu nombre de usuario y/o contraseña puedes recuperarla pinchando en el vínculo abajo:<br>\r\n<br>\r\n<a href=''{base_url}{recuperar}/spanish''>{base_url}{recuperar}/spanish</a><br>\r\n<br>\r\nSi tu programa de correo electrónico no te permite pinchar en el vínculo, copia el texto del vínculo y pégalo en la barra de dirección de tu explorador de Internet.<br>\r\n<br>\r\nSaludos Cordiales, <br>\r\nIANDRESA (Estamos aquí) <br>\r\n<br>\r\n<a title="Servicios" href="{base_url}index.php/login/show_menu/english/Services" style="text-decoration: none">\r\n<img alt=''IANDRESA'' width=''100'' src=''{base_url}images/logotipo/iandresalogoraton.png''/>\r\n</a>\r\n<br>\r\nSi tienes alguna duda, contáctanos a <a href="mailto:support@iandresa.com">support@iandresa.com</a>\r\n</body>\r\n</html>'),
